function HomeBanner() {
    return(
        <>
            <div className="container">
                <div className="section">
                    <div className="row">

                        <div className="col">
                        test1
                        </div>

                        <div className="col"> test 2</div>

                    </div>
                </div>
            </div>
        </>
    );
}

export default HomeBanner;
